    const token = useToken();

    useEffect(() => {
        fetch("https://api.spotify.com/v1/me", {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        }).then(res =>  res.json()).then(console.log)
    }, [token]); 

    useEffect(() => {
        const client = crudClient().
        then(console.log).catch(error => console.log(error.response.status))
    }, []);

    return(
        <Button onClick={() => window.location = oauthURL}>Login with Spotify</Button>
    );
}

export default Landing;
